comment: |-
  SELECT T1.countryId,
         T1.CountryName
  FROM Countries AS T1
  JOIN CAR_MAKERS AS T2 ON T1.CountryId = T2.Country
  GROUP BY T1.countryId
  HAVING count(*) > 3
  UNION
  SELECT T1.countryId,
         T1.CountryName
  FROM Countries AS T1
  JOIN CAR_MAKERS AS T2 ON T1.CountryId = T2.Country
  JOIN MODEL_LIST AS T3 ON T2.Id = T3.Maker
  WHERE T3.Model = 'fiat';

sql: |-
  SELECT T1.countryId,
         T1.CountryName
  FROM Countries AS T1
  JOIN CAR_MAKERS AS T2 ON T1.CountryId = T2.Country
  GROUP BY T1.countryId
  HAVING count(*) > 3
  UNION
  SELECT T1.countryId,
         T1.CountryName
  FROM Countries AS T1
  JOIN CAR_MAKERS AS T2 ON T1.CountryId = T2.Country
  JOIN MODEL_LIST AS T3 ON T2.Id = T3.Maker
  WHERE T3.Model = 'fiat';
